import './Platfrom.scss';
import { withTranslation } from 'react-i18next';
import { Header } from "../header/Header";
import { Footer } from "../footer/Footer";
import { PlatformHeader } from '../Platform-intro-app/PlatformHeader';

class Platfrom extends React.Component {
    render() {
        const { t } = this.props;
        return(
            <>
            <Header />
            <div className="ergonza-platform">
                <div className="ergonza-platform-wrapper">
                <div className="ergonza-platform-header">{t("ergonza-platform-header")}</div>
                <div className="ergonza-platform-intro">
                    <PlatformHeader />
                </div>
                <div className="ergonza-platform-info">
                    <div className="ergonza-platform-info-col-1"></div>
                    <div className="ergonza-platform-info-col-1"></div>
                </div>
                </div>
            </div>
            <Footer />
            </>
        )
    }
  }

export default withTranslation()(Platfrom);
